import Repo from '../components/Repo';
import { getApiData } from '../server/utils.js';
import * as actions from '../actions';

const Detail = ({}) => {
  return (
    <>
      <div>
        <a>md</a>
        <a>issues</a>
      </div>
    </>
  );
};

Detail.getInitialProps = async ({ ctx }) => {
  const { store } = ctx;
  const detailRepoData = await getApiData(ctx, '/api/detail');
  store.dispatch(actions.getDetailRepos(detailRepoData));
};

export default Detail;
